import {useState} from 'react';

export default function Focused(props) {
  const [focused, setFocused] = useState(props.focused)

  return (
    <div style={{
      position: "absolute", 
      width: "34vw", 
      height: "300px", 
      backgroundColor: "blue",
      left: "65.5vw",
      top: "9.2vh"
    }}></div>
  )
}
